import "./Caption.css";

export default function Caption() {
  return (
    <div className="Caption">
      <p>
        <i>
          visualization of computer vision <br />
          word classification system{" "}
        </i>{" "}
        <br />
        .upload <br />
        .trace <br />
        .tag <br />
      </p>
    </div>
  );
}
